require 'pry'
def product_except_self(nums)
  # result = []

  # nums.each_with_index do |_n, i|
  #   nums_excluding_n = nums[0...i] + nums[i + 1..]
  #   result << nums_excluding_n.reduce(:*)
  # end
  # result
  n = nums.length
  result = Array.new(n, 1)
  left_product = right_product = 1

  
  (0...n).each do |i|
    
    result[i] *= left_product
    left_product *= nums[i]
  end
  
  (n - 1).downto(0) do |i|
    result[i] *= right_product
    right_product *= nums[i]
  end


  result

end

